import $ from "jquery";


var elemJSON = { data: null };

$.ajax("/Elements.json", {
    dataType: "json",
    success: function(data, status, xhr) {
        elemJSON.data = data;
    },
    error: function (xhr, textStatus, errorMessage) {
        alert(errorMessage);
    }
});


export default elemJSON;
